import styled from 'styled-components';
export const Div0 = styled.div`
    height: 70px;
    width: 100%;
    border-bottom: 3px solid #7c9c99;
    display: flex;
    overflow: hidden;
    min-width: 1200px;
`
export const Divtop =styled.div`
    height: 70px;
    width: 100%;
    pedding-righ: 70px;
    box-sizing: border-box;
    margin: 0,auto;
`
export const LogoText = styled.p`
    font-size:30px;
    color:black;
    font-family: 'Noto Sans TC', sans-serif;
    width: 120px;
    margin-top: 30px;
    margin-left: 3px;
    float: left;
`
export const DivImg = styled.img`

`
